import axios from 'axios';
import React,{Component} from 'react';
import './Home.css'

class Home extends Component{

    constructor(props){
        super(props)
        this.state = {
            host : ''
        }
    }

    componentDidMount(){
        console.log("1");
        this._getHost();
        console.log("2");
    }

    _getHost = async() =>{
        const res = await axios.get('/api/host');
        console.log(res.data.host);
        this.setState({host:res.data.host})
    }

    render(){
        return(
            <main className="HomeTemplate">
                <div className="top">
                    <div className="title">
                        Home
                    </div>
                    <section className="form-wrapper">
                        <div>
                            <h1>khusinsa-home</h1>
                        </div>
                    </section>
                </div>
                <section className="Home-wrapper">
                    <div>
                        {this.state.host}
                        홈페이지 입니다.
                    </div>   
                </section>
            </main>
        )
    }
}
export default Home;
